import React from "react";
import {  Route } from "react-router-dom";
import "./App.css";
import Navbar from "./components/Navbar/Navbar";
import UsersContainer from "./components/Users/UsersContainer";
import ProfileContainer from "./components/Profile/ProfileContainer";
import LoginContainerFormik from "./components/Login/LoginContainerFormik";
import CommentsContainer from "./components/Comments/CommentsContainer";

const App = (props) => {

  return (
		<div className='app-wrapper'>
			<Navbar></Navbar>
			<div className='app-wrapper-content'>
				<Route
					path='/posts/:userId?/comments'
					render={() => <CommentsContainer />}
				/>
				<Route path='/posts/:userId?' render={() => <ProfileContainer />} />
				<Route path='/users' render={() => <UsersContainer />} />
				<Route
					path='/login'
					render={() => <LoginContainerFormik></LoginContainerFormik>}
				/>
			</div>
		</div>
	)
};

export default App;
